  "Initiated By" : "AMEX",
  "Allegations" : "THE EXCHANGE INSTITUTED A FORMAL DISCIPLINARY PROCEEDING AGAINST KEITH GEBLER (\"GEBLER\"), A FORMER BRANCH OFFICE MANAGER AND REGISTERED EMPLOYEE PRUDENTIAL SECURITIES (\"PRUDENTIAL SECURITIES\") A REGULAR MEMBER ORGANIZATION OF THE EXCHANGE. IN THE STATEMENT OF CHARGES IT WAS ALLEGED THAT FROM MID-AUGUST 1984 TO MARCH 1986, GEBLER FAILED TO SUPERVISE A REGISTERED REPRESENTATIVE IN VIOLATION OF EXCHANGE RULE 320 IN THAT AS BRANCH OFFICE MANAGER HE (i) PERMITTED UNSUITABLE OPTIONS TRADING IN A CUSTOMER'S \"REGULAR ACCOUNT\"; (ii) PERMITTED A REGISTERED REPRESENTATIVE TO CHURN THE ACCOUNTS OF A CUSTOMER; AND (iii) PERMITTED A REGISTERED REPRESENTATIVE TO USE UNAUTHORIZED DISCRETION IN THE ACCOUNTS OF A CUSTOMER.",
  "Resolution" : "Decision",
  "SanctionDetails" : [ {
    "Sanctions" : "Censure"
  } ],
  "Sanction Details" : "AT A CONTESTED HEARING CONDUCTED ON JANUARY 28 AND 29, 1993 AND JULY 13 AND 14, 1993, GEBLER WAS FOUND GUILTY OF PERMITTING A REGISTERED REPRESENTATIVE TO USE UNAUTHORIZED DISCRETION IN A CUSTOMER'S ACCOUNTS AND NOT GUILTY OF THE OTHER CHARGES. GEBLER WAS CENSURED.",
  "Broker Comment" : "IN 1985, PRIVATE PLACEMENT DOCUMENTS WERE ROUTINELY SENT DIRECTLY TO THE DIRECT INVESTMENT GROUP AT PRUDENTIAL BACHE SECURITIES FOR SUPERVISORY AND SUITABILITY REVIEWS. KEITH GEBLER HAD NO REASON TO BELIEVE THAT THIS TRANSACTION WAS NOT AUTHORIZED EVEN AFTER SUBSEQUENTLY MEETING PERSONALLY WITH THE CLIENT. IN ADDITION THERE WAS NO REASON TO BELIEVE THAT THE DOCUMENT WAS NOT PROPERLY NOTARIZED."
